import styled from 'styled-components';

export const Header = styled.header`

  height: 70%;
  width: 100%;
  `;

export const StyledHeaderImage = styled.img`
z-index: 0;
position: absolute;
width: 100%;
  height: 50%;
`;

export const InfoAbout = styled.div`
position: absolute;
z-index: 1;
  width: 4px;
  height: 373px;
  background-color: black;
`;
